import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import GetWish from "./API/GetWish.ts";

function ChangePage(props)
{
    const params = useParams();
    const id = params.id;
    const [present, setPresent] = React.useState("")
    const[price, setPrice] = React.useState(0)
    const [wish, setWish] = React.useState({id:0, present:"", price:"", reservUser:0, reservUserName:"", userId:0, userName:""})
    useEffect(()=>{
        const get = async () =>{
          const data = await GetWish(id);
          setWish(data);
          setPresent(wish.present)
          set
        }
        get();
      }, []);

      if(wish[0].id==0)
        return(<></>);  


    return(
        <div>
            <form>
                <h3>Изменить желание</h3>
                <p>
                    <label>Подарок </label>
                    <input type="text" value={present} onChange={(e) => setPresent(e.target.value)}></input>
                </p>
                <p>
                    <label>Цена </label>
                    <input type="number" value={price} onChange={(e) => setPrice(e.target.value)}></input>
                </p>
            </form>
        </div>
    )
}
export default ChangePage
